import React from 'react';
import Link from "next/link";

const IndexIntro = () => {
    const styles = {
        brand: {
            fontSize: '75px',
            marginRight: '20px'
        },
        title: {
            marginRight: '20px'
        }
    }

    return (
        <div>
            <div style={styles.brand}>
                HeyThere
            </div>
            <br/>
            <Link href="#" >
                Already Have a Account?
            </Link>
        </div>

    );
};

export default IndexIntro;
